import React, { Component } from 'react'
import './User.css'

export default class User extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: '',
            likedSongs: []
        }
    }
    render() {
        return (
            <div className='User'>
                <img src={this.props.userImage}/>
            </div>
        )
    }
}
